import React from 'react'
import UploadProducts from '../components/UploadProducts';

const AllProducts = () => {
  const [openUploadProducts,setOPenUploadProducts] = use
  return (
    <div>
      <div className='bg-white py-2 px-4 flex justify-between items-center'>
        <h2 className='font-bold text-lg'>All Products</h2>
        <button className='border-2 border-red-600 text-red-600 py-1 px-3 rounded-full hover:bg-red-600 hover:text-white transition-all'>Upload Products</button>
      </div>
       {/* Upload product component */}
       <UploadProducts/>
    </div>
  )
}

export default AllProducts;
